types.description:
Type that contains user time zone and its UTC offset,
e.g.:
{
    displayName: "US/Pacific",
    utc: "-07:00"
}

 Errors messages and codes mapped to
fields or non fields errors.
Example:
{
    field_name: [
        {
            "message": "error message",
            "code": "error_code"
        }
    ],
    other_field: [
        {
            "message": "error message",
            "code": "error_code"
        }
    ],
    nonFieldErrors: [
        {
            "message": "error message",
            "code": "error_code"
        }
    ]
}
